local _, class = UnitClass("player")
if class ~= "PRIEST" then return end


-- Get Addon object
local ASTimer = LibStub("AceAddon-3.0"):GetAddon("AS Timer")


-- Upvalues
local WeakAurasScanEvents
if IsAddOnLoaded("WeakAuras") then
	WeakAurasScanEvents = WeakAuras.ScanEvents
else
	WeakAurasScanEvents = function() end
end


-- Frames
local timerFrame = ASTimer.frame


-- Variables
local wa_as


-- Functions
local function refreshDisplay(orbs, timers)
	local count = #timers or 0
	wa_as.orbs = orbs
	wa_as.timers = timers
	WeakAurasScanEvents("WA_AUSPICIOUS_SPIRITS", count, orbs)
end

function ASTimer:initializeWeakauras()
	timerFrame:SetWidth(0)
	timerFrame:SetHeight(0)
	
	if not _G.wa_as then _G.wa_as = {} end
	wa_as = _G.wa_as
	wa_as.count = 0
	wa_as.orbs = UnitPower("player", 13)
	wa_as.timers = {}
	function wa_as.TimeLeft(timerId) return ASTimer:TimeLeft(timerId) end
	function ASTimer:refreshDisplay(orbs, timers) refreshDisplay(orbs, timers) end
	function timerFrame:HideChildren() end
end

